script: |
  super -f text -I q9660.spq | sort > q9660.out

inputs:
  - name: q9660.spq
    data: |
      SELECT DISTINCT + cor1.col1 / cor1.col0 + 30 AS col1 FROM tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1;
  - name: tab2

outputs:
  - name: q9660.out
    data: |
      30
      34
